                    <h1 class="push--ends">Kebijakan Privasi</h1>
                    <hr class="rule">
                    <p class="weight--semibold">Selamat Datang di Jaringan mediaoto</p>
                    <p>Kami www.mediaoto.id, sebagai bagian dari jaringan <a
                            href="https://www.mediaoto.id/">www.mediaoto.id</a>
                        - menghormati privasi pengunjung semua situs web kami yang dapat ditemukan di perusahaan kami -
                        www.mediaoto.id, situs web perusahaan-perusahaan affiliasi kami, dan mesin pencari kendaraan
                        mediaoto dimanapun yang didistribusikan di internet ('Jaringan mediaoto'). Silakan baca
                        Kebijakan Privasi dengan seksama sehingga Anda memahami informasi apa yang kami kumpulkan
                        melalui situs kami dan apa yang kami lakukan dengan informasi tersebut.</p>
                    <p>Kebijakan Privasi ini merupakan bagian dari Perjanjian Pengguna yang dapat ditemukan untuk
                        menggunakan www.mediaoto.id. </p>
                    <p class="weight--semibold">PERHATIAN</p>
                    <p>Bacalah persyaratan Kebijakan Privasi ini dengan baik sebelum mengunjungi Website. Dengan
                        mengunjungi Website ini, berarti Pengguna telah menyetujui seluruh Syarat dan Ketentuan
                        Kebijakan Privasi ini ini. Jika Pengguna tidak menyetujuinya, maka Pengguna dapat langsung
                        menghentikan penggunaan Website ini.</p>
                    <p class="weight--semibold">Tentang jaringan mediaoto</p>
                    <ol style="list-style: upper-alpha">
                        <li>mediaoto menerbitkan atau menyediakan informasi jaringan mediaoto, iklan, produk dan
                            penawaran layanan, data kendaraan, valuasi, software dan link, dan konten lain yang dipasok
                            oleh mediaoto serta pihak ketiga ('Material'). mediaoto tidak menjamin, mewakili,
                            menyetujui atau mendukung keandalan, ketepatan atau kelengkapan dari setiap materi tersebut
                            yang dipublikasikan di jaringan mediaoto atau pada setiap situs yang berhubungan dengan
                            jaringan mediaoto (Termasuk menampilkan iklan pihak ketiga).<br><br></li>
                        <li>mediaoto tidak dan tidak dapat memberikan jaminan apapun sehubungan dengan barang atau jasa
                            yang diiklankan untuk dijual di jaringan mediaoto oleh pihak ketiga, termasuk pernyataan
                            atau jaminan dari kualitas barang dan jasa yang diperdagangkan, cocok untuk digunakan atau
                            aman untuk digunakan, seperti yang dijelaskan oleh pihak penjual.
                        </li>
                    </ol>
                    <p class="weight--semibold">Apa yang termasuk dalam Kebijakan Privasi</p>
                    <p>Kebijakan Privasi ini mencakup perlakuan situs terhadap data pribadi yang dikumpulkan ketika Anda
                        berada di situs ini dan saat Anda menggunakan layanannya. Kebijakan ini juga menjelaskan
                        bagaimana perusahaan mengungkapkan data pribadi Anda. Kebijakan ini tidak menggambarkan
                        kebijakan pengumpulan informasi di situs lain, termasuk yang terkait dengan situs ini.</p>
                    <p>Jika Anda mengungkapkan data pribadi kepada pihak ketiga, kebijakan ini tidak akan berlaku dan
                        Anda akan tunduk pada kebijakan privasi pihak ketiga.</p>
                    <p>Dengan mengakses atau menggunakan layanan situs ini, termasuk jaringan mediaoto, Anda setuju
                        dengan penggunaan dan pengungkapan Data Pribadi Anda seperti yang dijelaskan dalam kebijakan
                        ini.</p>
                    <p class="weight--semibold">Informasi yang kami kumpulkan</p>
                    <p>Situs ini mengumpulkan Data Pribadi atau badan terkait yang dianggap perlu untuk perusahaan
                        menyediakan berbagai layanan yang mereka tawarkan. Informasi yang kami kumpulkan secara umum
                        terbagi dalam dua kategori:</p>
                    <ol>
                        <li>Informasi yang disediakan oleh pengunjung website ketika mereka:
                            <ol style="list-style: lower-alpha">
                                <li>Buat akun baru</li>
                                <li>Login ke account mereka</li>
                                <li>List, memodifikasi, menghapus mobil (dijual)</li>
                                <li>Melakukan pencarian</li>
                                <li>Klik untuk mengungkapkan informasi penjual</li>
                                <li>Ikut dalam undian atau kontes promosi lainnya</li>
                                <li>Meminta penawaran</li>
                                <li>Menanyakan tentang kendaraan yang terdaftar untuk dijual atau tentang produk atau
                                    layanan lain yang ditawarkan melalui website kami.
                                </li>
                            </ol>
                        </li>
                        <li>Informasi yang kami kumpulkan sebagai pengunjung menggunakan website kami.
                            <p>Anda harus mendaftar untuk menggunakan produk-produk tertentu, layanan, dan alat-alat di
                                website kami yang mengharuskan Anda untuk memberikan informasi tentang data pribadi
                                Anda, termasuk namun tidak terbatas pada nama lengkap, alamat fisik, alamat email, dan
                                nomor telepon. Anda dapat memberikan informasi tersebut jika Anda mendaftar untuk
                                account baru, newsletter, formulir "Feedback" kami, atau menggunakan alat media sosial.
                                Kami dapat menggunakan informasi tersebut untuk menyediakan Anda produk, jasa, atau alat
                                lain yang Anda minta.</p>
                            <p>Ketika Anda mendaftarkan iklan mobil dijual, kami meminta informasi tentang mobil dan
                                bagaimana Anda dapat dihubungi oleh calon pembeli (termasuk informasi seperti nomor
                                telepon dan alamat email).</p>
                            <p>Selain hal di atas, kami mengumpulkan informasi, dan/atau menggunakan informasi tersebut,
                                dalam cara tertentu sebagai berikut:</p>
                            <p><strong>Pencarian dan Daftar</strong></p>
                            <p>Untuk menggunakan fitur tertentu di situs kami, pengunjung perlu memberikan informasi
                                yang terbatas tentang diri mereka dan kepentingan mereka sehingga kita dapat
                                menyesuaikan informasi yang kami sediakan untuk kebutuhan mereka. Misalnya, untuk
                                membantu Anda menemukan mobil yang Anda inginkan lokasinya dekat dengan rumah Anda, kita
                                perlu tahu apa jenis mobil yang Anda cari dan dimana lokasi Anda. Kami meminta Anda
                                untuk memberikan informasi ini ketika Anda melakukan pencarian. Kami menggunakan
                                informasi ini untuk membantu Anda menemukan mobil yang Anda cari atau sebagaimana
                                diuraikan dalam Pernyataan Privasi ini.</p>
                            <p><strong>Undian dan Promosi Lainnya</strong></p>
                            <p>Dari waktu ke waktu, kami dapat menawarkan undian atau promosi lainnya di situs kami.
                                Jika Anda mengikuti undian atau kontes promosi, kami akan meminta Anda untuk memberikan
                                informasi tentang diri Anda (seperti nama, nomor telepon, alamat, tanggal lahir, dan
                                alamat email). Kami akan menggunakan informasi ini untuk menghubungi Anda jika Anda
                                menang, dan kami juga dapat menggunakan informasi ini untuk tujuan pemasaran. Kami dapat
                                membagikan informasi ini dengan co-sponsor dari kontes atau undian, dan kami akan
                                mengidentifikasi co-sponsor dalam aturan kontes. Kami juga dapat berbagi informasi ini
                                dengan penyedia layanan pihak ketiga lainnya yang membantu mengelola promosi kami,
                                seperti memberikan hadiah kepada pemenang. Jika Anda tidak ingin kami mengumpulkan Data
                                Pribadi untuk diberikan kepada co-sponsor, jangan mengikuti kontes atau undian.</p>
                            <p><strong>Survei Online</strong></p>
                            <p>Dari waktu ke waktu, kami melakukan survei kepada pengguna kami untuk mengukur kepuasan
                                mereka dengan situs kami dan situs lain, dan untuk membantu kami belajar lebih banyak
                                tentang pengguna kami dan bagaimana mereka berinteraksi dengan situs kami. Perusahaan
                                penelitian pihak ketiga seringkali melakukan survei ini atas nama kami. Kami menggunakan
                                hasil survei untuk membantu kami meningkatkan layanan yang kami tawarkan kepada Anda.
                                Kami akan mengambil informasi yang Anda berikan dan agregat itu secara anonim dengan
                                data yang dikumpulkan dari peserta survei lainnya. Kami dapat menggunakan informasi
                                anonim yang kita lihat cocok, tanpa mengidentifikasi Anda secara pribadi.</p>
                            <p>Anda juga dapat menemukan undangan di situs kami untuk berpartisipasi dalam survei yang
                                dilakukan oleh pengiklan kami, yang praktik privasinya tidak kami kontrol. Undangan ini
                                biasanya akan lterhubung ke bentuk survei online yang diselenggarakan baik oleh
                                pengiklan melakukan survei atau oleh perusahaan riset pihak ketiga yang bekerja atas
                                nama pengiklan. Ketika Anda mengakses survei pengiklan melalui situs kami, penggunaan
                                informasi yang Anda kirimkan akan diatur oleh kebijakan privasi pengiklan (atau oleh
                                kebijakan privasi perusahaan riset pengiklan), yang mungkin berbeda dari kami. Jika Anda
                                tidak dapat menemukan kebijakan privasi yang berlaku melalui link baik dari undangan
                                survei pengiklan atau dari bentuk survei online, Anda harus menghubungi pengiklan secara
                                langsung untuk informasi lebih lanjut.</p>
                            <p><strong>Alamat Email</strong></p>
                            <p>Kami dapat menggunakan alamat email Anda untuk menanggapi permintaan Anda tentang produk
                                atau layanan kami atau untuk menanggapi komunikasi Anda dengan kami. Kami juga dapat
                                menghubungi Anda untuk menanyakan tentang pengalaman Anda di website kami, untuk
                                memberikan Anda informasi tentang produk dan layanan yang tersedia dari kami atau dari
                                afiliasi kami, atau untuk berkomunikasi dengan Anda tentang informasi yang berkaitan
                                dengan industri otomotif. Dari waktu ke waktu, kami juga dapat mengirim email yang
                                mencakup promosi khusus dan penawaran komersial lainnya yang kami pikir mungkin menarik
                                bagi Anda. Kami harap Anda akan menganggap komunikasi ini informatif dan berguna. Jika
                                Anda tidak melakukannya, Anda dapat berhenti berlangganan dari salah satu program email
                                komersial kami dengan mengikuti petunjuk sederhana yang disertakan dalam email yang Anda
                                terima sehubungan dengan program itu.</p>
                            <p><strong>Akun Saya</strong></p>
                            <p>Menciptakan dan log in ke account Anda membantu Anda menemukan mobil yang tepat serta
                                memungkinkan Anda untuk melakukan hal-hal seperti, menyimpan pencarian favorit mobil
                                Anda, melihat permintaan mobil, dan mencari pembeli potensial. Hal ini juga memungkinkan
                                Anda menyesuaikan gambar profil Anda, edit nama depan, nama belakang, nomor telepon,
                                alamat, kode pos, dll.</p>
                            <p>Untuk mengakses akun Anda, kami akan meminta Anda untuk mendaftar pada form yang
                                tersedia, yang dapat mencakup Data Pribadi seperti alamat email Anda. Anda juga mungkin
                                diminta untuk memberikan tambahan Data Pribadi opsional, seperti nama, jenis kelamin,
                                dan usia. Anda setuju untuk memberikan informasi yang benar, akurat, terkini, dan
                                lengkap tentang diri Anda. Kami menggunakan informasi ini untuk memproses permintaan
                                pendaftaran Anda, menyediakan Anda layanan dan komunikasi yang Anda minta, menyesuaikan
                                fitur yang muncul di website, dan memperbaiki situs web kami serta layanan dan fitur
                                yang ditawarkan kepada pengguna. Kami dapat berbagi informasi yang kami kumpulkan saat
                                Anda menggunakan situs ini, termasuk informasi pendaftaran, dengan afiliasi kami dan
                                dengan penyedia layanan pihak ketiga terpercaya yang membantu kami dalam memberikan
                                pelayanan.</p>
                            <p><strong>Jaringan Sosial</strong></p>
                            <p>Bila Anda menggunakan salah satu alat berbagi jaringan sosial yang tersedia di website
                                kami, kami dan sistem operasi dari jaringan sosial dapat mengumpulkan informasi tentang
                                Anda berdasarkan penggunaan tersebut. Penggunaan informasi jaringan sosial akan tunduk
                                pada kebijakan privasi sendiri yang mungkin berbeda dari Kebijakan Privasi ini.</p>
                            <p><strong>Isi yang Anda Posting ke Situs kami</strong></p>
                            <p>Jika Anda memilih untuk mengirim konten ke area interaktif situs kami, seperti forum
                                diskusi, kolom komentar, dan area media sosial, harap diingat bahwa informasi yang Anda
                                posting dapat dilihat, dikumpulkan, dan digunakan oleh siapa saja yang memiliki akses ke
                                area itu. Anda juga mungkin memiliki kesempatan dari waktu ke waktu untuk menanggapi
                                pertanyaan yang kami tampilkan kepada pengguna situs. Jika Anda memilih untuk
                                menanggapi, respons Anda mungkin akan dipublikasikan di suatu area dari situs kami yang
                                dapat diakses oleh pengguna lain atau publik. Kami tidak bertanggung jawab atas
                                penggunaan informasi pihak ketiga tersebut.</p>
                            <p>If you choose to post content to any of the interactive areas of our website, such as
                                discussion
                                forums, comments fields, and social media areas, please keep in mind that the
                                information you
                                post can be seen, collected, and used by anyone who has access to those areas. You may
                                also have
                                the opportunity from time to time to respond to questions that we display to users of
                                the
                                website. If you choose to respond, your response may be published on an area of the
                                website
                                accessible to other users or the public. We are not responsible for any third-party use
                                of such
                                information.</p>
                        </li>
                    </ol>
                    <p class="weight--semibold">Cookies dan teknologi pengumpulan data lainnya</p>
                    <p><strong>Cookies</strong></p>
                    <p>Cookie digunakan untuk memantau penggunaan situs dan untuk mengumpulkan informasi seperti bagian
                        dari situs mana yang sering dikunjungi serta informasi penggunaan situs lain.</p>
                    <p>Informasi ini dikumpulkan sebelum penggunaan tersebut dan tidak mencakup Data Pribadi. Situs ini
                        menggunakan cookies untuk membuat Anda lebih efisien ketika Anda mengunjungi Situs.</p>
                    <p>Sebagian besar pengunjung situs awalnya menerima cookie. Namun, Anda dapat mengatur browser Anda
                        untuk menolak semua cookies atau memberitahu Anda bila Anda menerima cookies dan Anda akan
                        memiliki kesempatan untuk menerima atau menolak.</p>
                    <p>Harap dicatat, bagaimanapun, beberapa bagian dari layanan yang ditawarkan oleh situs mungkin
                        tidak berfungsi dengan baik jika anda menolak cookies.</p>
                    <p><strong>Web Beacons</strong></p>
                    <p>Untuk membantu kami (dan dalam beberapa kasus pengiklan dan penyedia pihak ketiga) melacak berapa
                        banyak pengguna yang mengakses halaman tertentu atau listing dalam situs kami, dan untuk melacak
                        bagaimana pengguna merespons iklan yang ditempatkan pada situs web pihak ketiga, kami mungkin
                        menempatkan sebuah file kecil, yang disebut sebuah web beacon, di halaman kami dan pada beberapa
                        iklan yang kami distribusikan.</p>
                    <p>Kami juga dapat menempatkan web beacon dalam email yang kami kirimkan kepada Anda. Ketika Anda
                        membuka salah satu email kami atau klik pada link dalam email tersebut, kami melacak klik
                        tersebut melalui data, untuk membantu kami menentukan minat Anda pada topik tertentu dan
                        mengukur efektivitas komunikasi kami kepada Anda. Jika Anda memilih untuk tidak dilacak dengan
                        cara ini, Anda tidak harus membuka email tersebut atau klik teks atau link dalam email.</p>
                    <p><strong>Informasi tentang komputer atau perangkat</strong></p>
                    <p>Web server kami (dan/atau server web yang dioperasikan oleh penyedia layanan kami) secara
                        otomatis mengumpulkan dan dapat menyimpan informasi yang terbatas tentang konfigurasi komputer
                        Anda ketika Anda mengunjungi website kami, termasuk:</p>
                    <ol>
                        <li>Jenis perangkat lunak browser yang Anda gunakan,</li>
                        <li>Sistem operasi yang Anda jalankan,</li>
                        <li>Resolusi monitor komputer Anda,</li>
                        <li>Alamat IP Anda. (Ini adalah alamat numerik yang digunakan oleh komputer yang terhubung ke
                            Internet untuk mengidentifikasi komputer Anda sehingga data (seperti halaman web yang ingin
                            Anda lihat) dapat dikirim kepada Anda. Kami juga menggunakan informasi alamat IP untuk
                            sistem administrasi (termasuk deteksi pencegahan penipuan) dan troubleshooting.
                        </li>
                    </ol>
                    <p>Kami juga dapat mengumpulkan informasi tentang website yang Anda kunjungi sebelum Anda masuk ke
                        situs kami serta situs web yang Anda kunjungi setelah Anda meninggalkan website kami.</p>
                    <p><strong>Gabungan Teknologi Informasi</strong></p>
                    <p>Cookies, beacon, informasi yang dikumpulkan tentang komputer atau perangkat, dan teknologi
                        pengumpulan data lainnya ("Teknologi Data") dapat digunakan secara individual atau dalam
                        kombinasi untuk menyediakan dan/atau mengelola layanan kami, untuk membantu kami memahami
                        perilaku pengguna, untuk memonitor situs kinerja, mengoptimalkan iklan dan kinerja iklan.</p>
                    <p><strong>Website Analytics</strong></p>
                    <p>Kami dapat mengumpulkan atau memiliki, data tentang bagaimana pengunjung menggunakan dan
                        bernavigasi melalui situs kami. Seperti, jumlah pengguna yang mengunjungi berbagai halaman dalam
                        situs, apa yang mereka klik, apakah mereka gulir ke atas atau bawah pada halaman tertentu,
                        mengisi formulir, dll. Kami menggunakan informasi ini untuk meningkatkan kualitas situs dan
                        belajar tentang pengguna, serta mengungkapkan hal itu kepada afiliasi kami (termasuk antara
                        lain, para anggota jaringan mediaoto), atau pihak ketiga.</p>
                    <p><strong>Pengiklanan</strong></p>
                    <p>Situs ini memiliki hubungan dengan jaringan pengiklan pihak ketiga tertentu dan layanan iklan
                        ("Iklan Layanan") yang mengumpulkan data, atau pesan pemasaran lain yang Anda lihat di situs
                        kami dan situs lainnya serta pada aplikasi mobile, termasuk situs yang dimiliki dan/atau
                        dioperasikan oleh afiliasi kami.</p>
                    <p>Jasa periklanan tersebut dapat melalui proses yang kami tidak kontrol untuk menggunakan Data
                        Teknologi dari perusahaan pihak ketiga dalam mengumpulkan data dari aktivitas Anda di situs ini.
                        Teknologi ini dapat digunakan untuk melacak perilaku pengguna, bagaimana produk dan layanan kami
                        yang ditawarkan, melakukan riset konsumen dan mungkin untuk memberikan Anda iklan yang relevan.
                        Perusahaan-perusahaan pengiklan juga dapat memperoleh informasi, termasuk Data Pribadi, dari
                        layanan yang Anda gunakan dari perusahaan lain, dan menggabungkan informasi yang mereka peroleh
                        melalui Teknologi Data. Pengumpulan dan penggunaan data ini tunduk pada kebijakan privasi mereka
                        sendiri.</p>
                    <p class="weight--semibold">Tujuan Penggunaan Data Pribadi</p>
                    <p>mediaoto mungkin saja menggunakan, memproses, mentransfer, dan/atau mengungkapkan data pribadi
